import React, { useEffect, useState } from "react";
import Input from "../../components/Input/Input";
import Btn from "../../components/Btn/Btn";
import "./profile.css";
import axios from 'axios'
import { useFormik } from "formik";
const Profile = () => {
  const [data,setData]=useState({})
  const fetchData =async()=>{
    const data = await axios.get(`https://jsonplaceholder.typicode.com/users`)
    setData(data.data)
  }
  useEffect(()=>{
    fetchData()
  },[])
  const formik = useFormik({
    initialValues: {
      name:`${data}`,
      email: "",
      state: "",
      gender: "",
      pan: "",
      aadhar: "",
      afhn: "",
      mn: "",
    },
  });
  console.log(data)
  // console.log(formik.values)
  return (
    <div className="profile_container">
      <div className="basic">
        <div className="heading spacing">
          <h5>Basic Details</h5>
        </div>
        <div>

          <Input
            label="Name"
            name="name"
            value={formik.values.name}
            handleChange={formik.handleChange}
          />
          <p>
            <em>*As per PAN</em>
          </p>
          <Input
            label="E-mail"
            name="email"
            value={formik.values.email}
            handleChange={formik.handleChange}
          />
          <Input
            label="State"
            name="state"
            value={formik.values.state}
            handleChange={formik.handleChange}
          />
          <Input
            label="Gender"
            name="gender"
            value={formik.values.gender}
            handleChange={formik.handleChange}
          />
          <Input
            label="PAN"
            name="pan"
            value={formik.values.pan}
            handleChange={formik.handleChange}
          />
          <Input
            label="Aadhar"
            name="aadhar"
            value={formik.values.aadhar}
            handleChange={formik.handleChange}
          />
          <Input
            label="Applicant's Father/Husband Name"
            name="afhn"
            value={formik.values.afhn}
            handleChange={formik.handleChange}
          />
          <Input
            label="Mother's Name"
            name="mn"
            value={formik.values.mn}
            handleChange={formik.handleChange}
          />
        </div>
      </div>
      <div className="account">
        <div className="heading spacing">
          <h5>Bank Details</h5>
        </div>
        <div>
          <Input label="Account Holder Name" name="ahn" />
          <Input label="Bank Name" name="bn" />
          <Input label="Account Number" name="an" />
          <Input label="IFSC" name="ifsc" />
          <Input label="Branch Name" name="brn" />
        </div>
      </div>
      <div className="current">
        <div className="heading spacing">
          <h5>Current Address</h5>
        </div>
        <div>
          <Input label="House/Plot/Door No." name="house" />
          <Input label="Street/Area" name="street" />
          <Input label="Landmark" name="land" />
          <Input label="City" name="city" />
          <Input label="Country" name="country" />
          <Input label="Pincode" name="pin" />
        </div>
      </div>
      <div className="current">
        <div className="heading spacing">
          <h5>Permanent Address</h5>
        </div>
        <div>
          <Input label="House/Plot/Door No." />
          <Input label="Street/Area" />
          <Input label="Landmark" />
          <Input label="City" />
          <Input label="Country" />
          <Input label="Pincode" />
        </div>
      </div>

      <Btn label="Submit" />
    </div>
  );
};

export default Profile;
